import { FETCH_TOBACCO, STATE_MENU } from "./types";

export const fetchTobacco = async (tobacco) => {
	return (dispatch) => {
		dispatch({ type: FETCH_TOBACCO, payload: tobacco });
	};
};

export const changeStateMenu = async (stateMenu) => {
	return (dispatch) => {
		dispatch({ type: STATE_MENU, payload: stateMenu });
	};
};
